import React from "react";
import { useHttp } from "../hooks/http.hook";

export const MainPage = () =>{
    const {request} = useHttp();

    const getData = async () => {
        try
        {
            const data = await request('/api', 'POST', {});
            console.log('Data', data);
        }
        catch(error){}
    }

    return(
        <div>
            <h1>MainPage</h1>
            <button oneClick = {getData}></button>
        </div>
    )
}
